def create_dynamic_template(html_template: str, placeholders_input: dict):

    # Check if the input dictionary contains all necessary placeholder names
    required_placeholders = {"name", "email"}
    if not all(placeholder in placeholders_input for placeholder in required_placeholders):
        raise ValueError("Missing required placeholders: name, email")

    # Use regular expressions to find and extract placeholder patterns
    pattern = re.compile(r'\{\s*(\w+)\s*\}')
    matches = pattern.findall(html_template)

    # Iterate over the matches and substitute the placeholder with the corresponding value
    for match in matches:
        placeholder = match.strip("{}")
        if placeholder in placeholders_input:
            html_template = html_template.replace(match, placeholders_input[placeholder])

    return html_template

