def execute_custom_query(data, query):

    # Use regular expressions to parse the query string
    pattern = re.compile(r'SELECT|WHERE|ORDER BY (.*)')
    match = pattern.match(query)
    if not match:
        raise ValueError("Invalid query syntax")

    # Extract the necessary information for the query execution
    operation = match.group(1)
    column = match.group(2)
    if operation == 'SELECT':
        return [item[column] for item in data]
    elif operation == 'WHERE':
        return [item for item in data if item[column]]
    elif operation == 'ORDER BY':
        return sorted(data, key=lambda item: item[column])

    return data

